import 'animate.css'
import Image from ''
import React from "react";
import loadingPic from './bg.png'
const LandingPage = () => {
  return (
  <main className=' items-center justify-center justify-items-center align-middle'>
    <div className='flex flex-col md:flex-row w-full md:justify-between justify-center my-10 align-top'>
    <Image />
    </div>
  </main>
  );
};



export default LandingPage;
